import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import ClienteBusqueda from "./components/ClientesBusqueda/ClientesBusqueda";
import "@fontsource/roboto/300.css";

function App() {
    return (
    <BrowserRouter>
        <Routes>
            <Route path='home' element={<ClienteBusqueda/>}/>
        </Routes>
    </BrowserRouter>

    );
}

export default App;
